import React, { useState } from 'react';
import apiClient from '../../utils/axios';

const ApiTest = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const testApi = async () => {
    setLoading(true);
    setError(null);
    setData(null);
    
    try {
      // Spring Boot ÏÑúÎ≤ÑÍ∞Ä Ïã§Ìñâ Ï§ëÏù∏ÏßÄ ÌôïÏù∏ÌïòÎäî Í∞ÑÎã®Ìïú ÌÖåÏä§Ìä∏
      const response = await apiClient.get('/test');
      setData(response.data);
    } catch (err) {
      setError(err.response?.data?.message || err.message);
    } finally {
      setLoading(false);
    }
  };

  // POST ÏöîÏ≤≠ ÏòàÏãú (Î°úÍ∑∏Ïù∏)
  const login = async (credentials) => {
    try {
      const response = await apiClient.post('/login', credentials);
      
      // ÌÜ†ÌÅ∞ Ï†ÄÏû•
      if (response.data.accessToken) {
        localStorage.setItem('accessToken', response.data.accessToken);
        localStorage.setItem('refreshToken', response.data.refreshToken);
      }
      
      return response.data;
    } catch (err) {
      throw new Error(err.response?.data?.message || 'Î°úÍ∑∏Ïù∏Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
    }
  };

  // PUT ÏöîÏ≤≠ ÏòàÏãú
  const updateData = async (id, updateData) => {
    try {
      const response = await axios.put(`/notice/update/${id}`, updateData);
      return response.data;
    } catch (err) {
      throw new Error(err.response?.data?.message || 'ÏóÖÎç∞Ïù¥Ìä∏Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
    }
  };

  // DELETE ÏöîÏ≤≠ ÏòàÏãú
  const deleteData = async (id) => {
    try {
      const response = await axios.delete(`/notice/delete/${id}`);
      return response.data;
    } catch (err) {
      throw new Error(err.response?.data?.message || 'ÏÇ≠Ï†úÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
    }
  };

  return (
    <div style={{ 
      padding: '20px', 
      margin: '20px', 
      border: '2px solid #4b94d0', 
      borderRadius: '10px',
      backgroundColor: '#f8f9fa'
    }}>
      <h2 style={{ color: '#4b94d0' }}>üîó React ‚Üî Spring Boot Ïó∞Îèô ÌÖåÏä§Ìä∏</h2>
      
      <button 
        onClick={testApi} 
        disabled={loading}
        style={{
          padding: '10px 20px',
          backgroundColor: '#4b94d0',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: loading ? 'not-allowed' : 'pointer',
          fontSize: '16px'
        }}
      >
        {loading ? 'üîÑ API Ìò∏Ï∂ú Ï§ë...' : 'üöÄ Spring Boot API ÌÖåÏä§Ìä∏'}
      </button>
      
      {error && (
        <div style={{ 
          color: 'red', 
          marginTop: '10px',
          padding: '10px',
          backgroundColor: '#ffe6e6',
          borderRadius: '5px'
        }}>
          ‚ùå ÏóêÎü¨: {error}
        </div>
      )}
      
      {data && (
        <div style={{ marginTop: '10px' }}>
          <h4 style={{ color: '#28a745' }}>‚úÖ API ÏùëÎãµ ÏÑ±Í≥µ!</h4>
          <pre style={{ 
            background: '#f4f4f4', 
            padding: '10px',
            borderRadius: '5px',
            overflow: 'auto',
            maxHeight: '300px'
          }}>
            {JSON.stringify(data, null, 2)}
          </pre>
        </div>
      )}
      
      <div style={{ marginTop: '15px', fontSize: '14px', color: '#666' }}>
        <p>üí° <strong>ÌÖåÏä§Ìä∏ Î∞©Î≤ï:</strong></p>
        <ul>
          <li>Spring Boot ÏÑúÎ≤ÑÍ∞Ä Ïã§Ìñâ Ï§ëÏù∏ÏßÄ ÌôïÏù∏ (8888 Ìè¨Ìä∏)</li>
          <li>ÏúÑ Î≤ÑÌäºÏùÑ ÌÅ¥Î¶≠ÌïòÏó¨ API Ìò∏Ï∂ú ÌÖåÏä§Ìä∏</li>
          <li>ÏÑ±Í≥µÌïòÎ©¥ JSON Îç∞Ïù¥ÌÑ∞Í∞Ä ÌëúÏãúÎê©ÎãàÎã§</li>
          <li>Ïã§Ìå®ÌïòÎ©¥ ÏóêÎü¨ Î©îÏãúÏßÄÍ∞Ä ÌëúÏãúÎê©ÎãàÎã§</li>
        </ul>
      </div>
    </div>
  );
};

export default ApiTest;
